CREATE DEFINER=`root`@`localhost` PROCEDURE `Buscar_contrato` (`datos` VARCHAR(50))  begin
      Select C.CodigoContrato ,CL.Nombres as Cliente,P.Nombre AS Vendedor,
    C.NumeroContrato,C.TipoContrato,consecutivo,C.monto,C.plazo,C.cuota,C.zona,C.Lugar_cobro,C.FechaCobro,FormaPago,C.observacion,C.FechaContrato,C.contrato,C.Estado,C.CodigoCliente,C.codigo_personal,concat_ws(CL.Direccion,"- ",Direccion2) AS Direccion
    From contratos C Inner Join cliente CL on C.CodigoCliente =CL.Codigo_Cliente INNER JOIN  personal P ON C.codigo_personal=P.Codigo_Personal  where    CL.Documento like concat(datos,'%') or CL.Nombres like concat(datos,'%')  limit 50;  
   
    end$$

