CREATE DEFINER=`root`@`localhost` PROCEDURE `Devolver_monto_credito_cobros` (`Codigo_contratos` INT, OUT `montos` DECIMAL)  BEGIN
declare montoactual decimal;
declare liquidado decimal;
declare trasladado decimal;
declare acreditado decimal;
declare montocontrato decimal;
	If(not exists(Select Codigo_contrato  From creditos where Codigo_contrato=Codigo_contratos))then

 			set montoactual=(select monto from contratos where CodigoContrato=Codigo_contratos);

 		else 
        	set montoactual=(SELECT min(monto_actual)  FROM  creditos where Codigo_contrato =Codigo_contratos);
            end if;

 		 set montocontrato=(SELECT monto  FROM  contratos where CodigoContrato  =Codigo_contratos);
	
           
          
                If(not exists(Select Total  From liquidacion where CodigoContrato=Codigo_contratos))then
               set liquidado=0;
               else
                 set liquidado=(SELECT sum(Total)  FROM   liquidacion where CodigoContrato   =Codigo_contratos);
               end if;
               
                If(not exists(Select monto  From traslado_contrato where CodigoContrato=Codigo_contratos))then
               set trasladado=0;
               else
                 set trasladado=(SELECT sum(monto)  FROM   traslado_contrato where CodigoContrato=Codigo_contratos);
                 
 		end if;
        
        If(not exists(Select monto  From traslado_contrato where CodigoContrato2 =Codigo_contratos))then
               set acreditado=0;
               else
                 set acreditado=(SELECT sum(monto)  FROM   traslado_contrato where CodigoContrato2 =Codigo_contratos);
 		end if;
        
        set montos=((((montocontrato-montoactual)+acreditado)-trasladado)-liquidado);
        
    
END$$

