                                If(@Cant<100000) then

                                    Set NroCorrelativos='00'+LTRIM(STR(Cant));

                                Else

                                    If(Cant<1000000)then

                                        Set NroCorrelativos='0'+LTRIM(str(Cant));

                                    Else

                                        If(Cant<10000000)then

                                            Set NroCorrelativos=LTRIM(str(Cant));

        End if;
            End if;
